import React, { Fragment, useEffect } from 'react';

const Todos = () => {

    const fetchData = async() => {
        try {
            const res = await fetch("http://localhost:5000/todos");
        } catch (error) {
            console.error(error.message);
        }
    }

    useEffect(()=> {
        fetchData();
    }, []);

    return (
        <Fragment>
            <Card />
            <CardList />
        </Fragment>
    );
}

export default Todos;
